Leigh syndrome = bilateral lesions in basal ganglia, especially the striatum, diencephalon (mainly the medial aspect of the thalamus), &amp; brainstem (substantia nigra, oculomotor nuclei, periaqueductal gray matter, &amp; inferior olivary nuclei)
Read more in the paper
